import React from "react";
import { Button } from "@mui/material";

const redUnderLine=()=>{
  return <div>ADASD</div>
};

export default function AboutPageButton({ Text }) {
  return (
    <Button onClick={redUnderLine} disableRipple={1} style={{ background: "none" }}>
      {Text}
    </Button>
  );
}
